import React from 'react'
import '../styles/HomePageWelcome.css'
import Pyramid from "../assets/svgs/pyramid.svg"
function HomePageWelcome() {

  const observer = new IntersectionObserver((entries) =>{
    entries.forEach((entry)=>{
        console.log(entry)
        console.log("Seen")
        if(entry.isIntersecting){
          entry.target.classList.add('show');
        } else{
          entry.target.classList.remove('show');
        }
    })
  })

  const title = document.querySelectorAll('.hidden');
  title.forEach((el) => observer.observe(el));

  return (
    <>
    <div className="HPWelcomeBody">
      <section className='hidden'> <h1>Get ready to looose money!</h1></section>
     
